import Bar from "../../components/bar";
import Hamburguer from "../../components/hamburguer";
import { MainContainer, Area } from "./styles.js";

const Dashboard = () => {
  return (
    <>
      <Bar />
      <MainContainer>
        <div className="Container">
          <Area>
            <Hamburguer />
          </Area>
        </div>
      </MainContainer>
    </>
  );
};

export default Dashboard;
